import React, { useEffect, useState } from 'react'
import { useSelector } from 'react-redux'
import { language } from '../../utils/utils';
import ComplaintInfo from './ComplaintInfo';

function Complaints() {

  const { user } = useSelector(state => state.auth)
  const { complaints } = useSelector(state => state.complaints);

  if (complaints.length !== 0) {
    return (
      <table class="table">
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">
              {language.includes("tr") ? "Başlık" : "Title"}
            </th>
            <th scope="col">
              {language.includes("tr") ? "Detay" : "Detail"}
            </th>
            <th scope="col">
              {language.includes("tr") ? "Olaylar" : "Events"}
            </th>
          </tr>
        </thead>


        {complaints.map((complaint, index) => {
          return (
            <ComplaintInfo key={complaint._id} complaintInfo={complaint} index={index} />
          )
        })}
      </table>
    )
  } else {
    return (
      <table class="table">
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">
              {language.includes("tr") ? "Başlık" : "Title"}
            </th>
            <th scope="col">
              {language.includes("tr") ? "Detay" : "Detail"}
            </th>
            <th scope="col">
              {language.includes("tr") ? "Olaylar" : "Events"}
            </th>
          </tr>
        </thead>

        <tbody>
            <div class="w-100 bg-danger" role="alert">
              {language.includes("tr") ? "Şikayet Bulunmamaktadır." : "No Complaints."}
            </div>
        </tbody>

      </table>
    )
  }
}

export default Complaints
